con:testSuite.con:setupScript:
import jxl.*
// import jxl.write.*

Workbook workbook = Workbook.getWorkbook(new File("c:\\soapui-test-data.xls"))

Sheet firstSheet = workbook.getSheet(0)

int totalNoOfRows = firstSheet.getRows();
int totalNoOfCols = firstSheet.getColumns();

// row 0 is reserved for excel column headers
for (int row = 1; row < totalNoOfRows; row++) {
	String testcaseName = firstSheet.getCell(0,row).getContents();
	log.info(testcaseName);
	List dataList = []
	// column 0 is reserved for test case names;
	for (int col = 1; col < totalNoOfCols; col++) {
		dataList.push(firstSheet.getCell(col,,row).getContents());
     }
     context.setProperty(testcaseName, dataList)
     log.info("Adding to context: "+ testcaseName + ": "+dataList);
}

